      var items = [colorPicker.colorStops("Color Stops", color_stops), colorPicker.colorPickerInputContinuous("Min", self.uniqValues[cat_id]["min"]), colorPicker.colorPickerInputContinuous("Max", self.uniqValues[cat_id]["max"])];
